// import { Fragment } from 'react';
import styled,{css} from "styled-components";
// import './App.css';

const ButtonOne = styled.button`
  position : relative;
  left : 50%;
  transform : translateX(-50%);
  padding : 20px;
  border : 4px solid ${(props)=>props.color};
  font-size : 1.2rem;


  ${(props)=>
    props.bold && 
    css`
        color : ${(props)=>props.color};
        font-wieght : 600; 
    `};
`;

function App() {
  return (
    <>
    <ButtonOne color="gray">그레이 버튼</ButtonOne>
    <ButtonOne color="green" >그린 버튼</ButtonOne>
    </>
  );
}

export default App;
